import React from "react";

const Navigation = ({onRouteChange, isSignedIn}) => {
  if (isSignedIn) {
    return (
      <nav className="flex justify-end">
        <p onClick={() => onRouteChange('signin')} className="tr f3 link dim black underline pa3 pointer">Sign Out</p>
      </nav>
    );
  } else {
    return (
      <nav className="flex justify-end">
        <p onClick={() => onRouteChange('signin')} className="tr f3 link dim black underline pa3 pointer">Sign In</p>
        <p onClick={() => onRouteChange('register')} className="tr f3 link dim black underline pa3 pointer">Register</p>

      </nav>
    );
  }
}

export default Navigation;
